import React, { useState, useEffect } from 'react';
import Header from "../../Components/Header";
import Footer from "../../Components/Footer";
// import components
import JokeCard from "../../Components/JokeCard";
import "./style.css";


// ajax call to save saved joke to database
// get save button to work


export default function Jokes() {
    var jokesTitle = "Dad Jokes";
    const [jokeArr, setJokeArr] = useState([]);
    // const jokeArr = [];

    useEffect(() => {
        jokeSearch()
        console.log(jokeArr)
    },[])

    // joke api call
    function jokeSearch() {
        // for some reason the slack api link works best
        var queryURL = "https://icanhazdadjoke.com/slack";

        fetch(
            queryURL,
            {
              method: "GET",
            }
          )
            .then(res => res.json())
            .then(response =>
            //   this.setJokeArr()
            // console.log(response.attachments[0].text);
            this.setJokeArr(response.attachments[0].text)
            )
            .catch(error => console.log(error));

    };

    return (
        <div className="joke-body">
            <Header
                pageTitle={jokesTitle.toUpperCase()}
            />
            {/* content here */}
            {/* {jokeArr.map(res => (
                <JokeCard
                    joke={res}
                />
            ))} */}
            <Footer />
        </div>
    )
}
